import Navbar from '../components/navbar';
import Footer from '../components/footer';
import { Fragment } from 'react';

const Layout = (props) => {
    return (
        <Fragment>
            <Head>
                <title>My page</title>
            </Head>
            <Navbar/>

            <Footer/>
        </Fragment>

    );
}



  export default Layout;
